const DogCard = ({ dog, toggleFav, isFav }) => {
    const placeholderImg = '/path/to/placeholder-image.jpg'; // Replace with the actual path to a placeholder image

    return (
        <div className="dog-card">
            <img src={dog.img || placeholderImg} alt={dog.name || 'Dog'} />
            <h3>{dog.name}</h3>
            <p>Breed: {dog.breed}</p>
            <p>Age: {dog.age}</p>
            <p>Location: {dog.zip_code}</p>
            <button onClick={() => toggleFavorite(dog)}>
                {isFav ? 'Unfavorite' : 'Favorite'}
            </button>
        </div>
    );
};

export default DogCard;
